-- Sri Lanka Accommodation DW - Star Schema (fixed SK lengths, no CREATE DATABASE)

-- Drop tables if they exist (order respects FKs)
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS Fact_BookAccommodation;
DROP TABLE IF EXISTS Dim_SafetyOfAreaOfAccommodation;
DROP TABLE IF EXISTS Dim_WeatherOfAreaOfAccommodation;
DROP TABLE IF EXISTS Dim_Room;
DROP TABLE IF EXISTS Dim_Accommodation;
DROP TABLE IF EXISTS Dim_AccommodationLocation;
DROP TABLE IF EXISTS Dim_AccommodationType;
DROP TABLE IF EXISTS Dim_Customer;
DROP TABLE IF EXISTS Dim_Payment;
DROP TABLE IF EXISTS Dim_Date;
DROP TABLE IF EXISTS Dim_Month;
SET FOREIGN_KEY_CHECKS=1;


CREATE TABLE Dim_Month (
  MonthSK CHAR(7) PRIMARY KEY,           -- 'YYYY-MM'
  MonthCode TINYINT NOT NULL CHECK (MonthCode BETWEEN 1 AND 12),
  MonthName VARCHAR(20) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE Dim_Date (
  DateSK CHAR(10) PRIMARY KEY,           -- 'YYYY-MM-DD'
  MonthSK CHAR(7) NOT NULL,
  Year SMALLINT NOT NULL,
  Holiday VARCHAR(100) NULL,
  PoyaDay BOOLEAN NOT NULL DEFAULT FALSE,
  CONSTRAINT fk_dim_date_month FOREIGN KEY (MonthSK) REFERENCES Dim_Month(MonthSK)
) ENGINE=InnoDB;


CREATE TABLE Dim_Payment (
  PaymentSK CHAR(12) PRIMARY KEY,
  PaymentCode VARCHAR(20) NOT NULL,
  PaymentMethod VARCHAR(50) NOT NULL,
  Currency CHAR(3) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE Dim_Customer (
  CustomerSK CHAR(12) PRIMARY KEY,
  CustomerCode VARCHAR(20) NOT NULL,
  CustomerName VARCHAR(120) NOT NULL,
  CountryOfOrigin VARCHAR(80) NOT NULL,
  Married BOOLEAN,
  Age TINYINT,
  Active BOOLEAN DEFAULT TRUE,
  DateActiveFrom CHAR(10),
  DateActiveTill CHAR(10)
) ENGINE=InnoDB;


CREATE TABLE Dim_AccommodationType (
  AccommodationTypeSK CHAR(14) PRIMARY KEY,
  AccommodationTypeCode VARCHAR(30) NOT NULL,
  AccommodationTypeName VARCHAR(80) NOT NULL,
  NumberOfRooms INT NULL
) ENGINE=InnoDB;


CREATE TABLE Dim_AccommodationLocation (
  AccommodationLocationSK CHAR(12) PRIMARY KEY,
  AccommodationLocationCode VARCHAR(30) NOT NULL,
  Province VARCHAR(50) NOT NULL,
  District VARCHAR(50) NOT NULL,
  City VARCHAR(80) NOT NULL,
  Environment VARCHAR(40) NOT NULL  -- Beach, Hill Country, City, Wildlife, Cultural, etc.
) ENGINE=InnoDB;


CREATE TABLE Dim_Accommodation (
  AccommodationSK CHAR(12) PRIMARY KEY,
  AccommodationCode VARCHAR(30) NOT NULL,
  AccommodationName VARCHAR(150) NOT NULL,
  AccommodationTypeSK CHAR(14) NOT NULL,
  AccommodationLocationSK CHAR(12) NOT NULL,
  CONSTRAINT fk_acc_type FOREIGN KEY (AccommodationTypeSK) REFERENCES Dim_AccommodationType(AccommodationTypeSK),
  CONSTRAINT fk_acc_loc FOREIGN KEY (AccommodationLocationSK) REFERENCES Dim_AccommodationLocation(AccommodationLocationSK)
) ENGINE=InnoDB;


CREATE TABLE Dim_Room (
  RoomSK CHAR(12) PRIMARY KEY,
  RoomCode VARCHAR(30) NOT NULL,
  RoomName VARCHAR(100) NOT NULL,
  NumberOfBeds TINYINT NOT NULL,
  ClassOfRoom VARCHAR(40) NOT NULL, -- e.g., Standard, Deluxe, Suite
  RateOfRoom DECIMAL(10,2) NOT NULL,
  AccommodationSK CHAR(12) NOT NULL,
  CONSTRAINT fk_room_acc FOREIGN KEY (AccommodationSK) REFERENCES Dim_Accommodation(AccommodationSK)
) ENGINE=InnoDB;


CREATE TABLE Dim_WeatherOfAreaOfAccommodation (
  WeatherOfAreaOfAccommodationSK CHAR(15) PRIMARY KEY,
  WeatherOfAreaOfAccommodationCode VARCHAR(30) NOT NULL,
  MonthSK CHAR(7) NOT NULL,
  AverageTemperature DECIMAL(5,2) NULL,
  AveragePrecipitation DECIMAL(6,2) NULL,
  AccommodationLocationSK CHAR(12) NOT NULL,
  CONSTRAINT fk_weather_month FOREIGN KEY (MonthSK) REFERENCES Dim_Month(MonthSK),
  CONSTRAINT fk_weather_loc FOREIGN KEY (AccommodationLocationSK) REFERENCES Dim_AccommodationLocation(AccommodationLocationSK)
) ENGINE=InnoDB;


CREATE TABLE Dim_SafetyOfAreaOfAccommodation (
  SafetyOfAreaOfAccommodationSK CHAR(12) PRIMARY KEY,
  SafetyOfAreaOfAccommodationCode VARCHAR(30) NOT NULL,
  MonthSK CHAR(7) NOT NULL,
  AccidentRate DECIMAL(6,3) NULL,     -- hypothetical incidents per 10k residents
  CrimeRate DECIMAL(6,3) NULL,        -- hypothetical crimes per 10k residents
  AccommodationLocationSK CHAR(12) NOT NULL,
  CONSTRAINT fk_safety_month FOREIGN KEY (MonthSK) REFERENCES Dim_Month(MonthSK),
  CONSTRAINT fk_safety_loc FOREIGN KEY (AccommodationLocationSK) REFERENCES Dim_AccommodationLocation(AccommodationLocationSK)
) ENGINE=InnoDB;


CREATE TABLE Fact_BookAccommodation (
  BookAccommodationSK CHAR(12) PRIMARY KEY,
  BookAccommodationCode VARCHAR(30) NOT NULL,
  CustomerSK CHAR(12) NOT NULL,
  PaymentSK CHAR(12) NOT NULL,
  RoomSK CHAR(12) NOT NULL,
  CheckinDateSK CHAR(10) NOT NULL,
  CheckoutDateSK CHAR(10) NOT NULL,
  Discount DECIMAL(5,2) DEFAULT 0.00,
  TotalAmount DECIMAL(12,2) NOT NULL,
  CONSTRAINT fk_fact_customer FOREIGN KEY (CustomerSK) REFERENCES Dim_Customer(CustomerSK),
  CONSTRAINT fk_fact_payment FOREIGN KEY (PaymentSK) REFERENCES Dim_Payment(PaymentSK),
  CONSTRAINT fk_fact_room FOREIGN KEY (RoomSK) REFERENCES Dim_Room(RoomSK),
  CONSTRAINT fk_fact_checkin FOREIGN KEY (CheckinDateSK) REFERENCES Dim_Date(DateSK),
  CONSTRAINT fk_fact_checkout FOREIGN KEY (CheckoutDateSK) REFERENCES Dim_Date(DateSK)
) ENGINE=InnoDB;

